A celebration of LIFE!

This weekend, we celebrated the new life my daughter @shxkiraa is about to bring into this world. 

I was also celebrating the extension of her life. 

This time last year, doctors said my daughter was on the verge of a heart attack or stroke, and now she’s the healthiest she’s ever been. 

Since she was born, I’ve been calling @shxkiraa my Care Bear, so I made sure she got a BEARY special celebration. 

Before I share highlights, I first wanted to acknowledge the people who helped make it all possible. 

@connieamartey , thank you for keeping me sane and on the ball with tasks since I haven’t planned an event in years! ☑️

@lexyballoons for helping bring the vision to life and guiding me on the decor. 🎈

@cheflatoyafagon for the venue and catering. 🧆

My eldest daughter, @chardxnnay_ , worked tirelessly to create the sweets table her sister would love. 🍭

@dluxephotobooths_ for capturing the joy of our guests. 📸

@djmajesty101 for setting the atmosphere with the perfect vibes. 🎶

And last but not least, my partner for tolerating my mood swings, obsession and countless requests. 

Thank you to all who came to support the new parents, bless them with love and shower them with gifts.
